import React from "react";
import AnswerItem from "./AnswerItem";

const AnswersList = (answers: any) => {
  return (
    <div>
      <ul>
        {answers.map((answer: any) => {
          <li>
            <AnswerItem answer={answer} />
          </li>;
        })}
      </ul>
    </div>
  );
};

export default AnswersList;
